import React, { Component } from "react";
import Counter from "./counter";

class Counters extends Component {
  state = {
    counters: [
      { id: 1, value: 4 },
      { id: 2, value: 0 },
      { id: 3, value: 0 },
      { id: 4, value: 0 }
    ]
  };

  onDelete = () => {
    console.log("on Delete was called");
  };

  render() {
    return (
      <div>
        {" "}
        {this.state.counters.map(counter => (
          <Counter
            key={counter.id}
            onClick={this.counters.onDelete()}
            value={counter.value}
            id={counter.id}
          />
        ))}
      </div>
    );
  }
}

export default Counters;
